import React from 'react';

const PropertyCard = ({ property }) => {
  const { image, title, location, price, area } = property;

  return (
    <div className="relative overflow-hidden rounded-[20px] aspect-[16/10] group cursor-pointer">
      {/* Image */}
      <img
        src={image}
        alt={title}
        className="w-full h-full object-cover"
      />

      {/* Dark gradient overlay */}
      <div className="absolute inset-0 bg-gradient-to-t from-[#00513B]/95 via-[#00513B]/50 to-transparent" />

      {/* White line */}
      <div className="absolute bottom-[4.5rem] left-6 right-6 h-[1px] bg-white/30" />

      {/* Content */}
      <div className="absolute inset-0">
        {/* Title and Price */}
        <div className="absolute bottom-24 left-6 right-6">
          <div className="flex justify-between items-start">
            <h3 className="text-white text-[28px] font-medium leading-[1.2] max-w-[60%]">
              {title}
            </h3>
            <span className="text-white text-[32px] font-medium">
              {price}
            </span>
          </div>
        </div>

        {/* Bottom content - Location and Area */}
        <div className="absolute bottom-0 left-0 right-0 px-6 py-4">
          <div className="flex justify-between items-center">
            <p className="text-white text-base font-bold leading-[21px]">
              {location}
            </p>
            <p className="text-white text-base font-bold leading-[21px]">
              {area}
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PropertyCard;
